// icons.js

import { library } from '@fortawesome/fontawesome-svg-core';
import {faCircleChevronDown, faCoffee, faAddressCard, faEnvelope } from '@fortawesome/free-solid-svg-icons';

library.add(faCircleChevronDown,faCoffee, faAddressCard, faEnvelope);

export {faCircleChevronDown, faCoffee, faAddressCard, faEnvelope };
